import Layout from '../components/MyLayout';
import Link from 'next/link';

const PostLink = props => (
  <li>
    <Link href={`/p/[id]`} as={`/p/${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </li>
);

const index = () => (
  <Layout>
    <h1>My Blog</h1>
    <ul>
      {['hello-nextjs', 'learn-nextjs', 'deploy-nextjs'].map(title => {
        return (
          <PostLink
            key={title}
            id={title}
          />
        );
      })}
    </ul>
  </Layout>
);


export default index;
